import logo from './favicon.png';
import './App.css';
import React from 'react';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state ={
      logo: true
    }
    this.loading = this.loading.bind(this);
  }

  componentDidMount() {
    this.loading
  }

  loading() {

  }

  render() {
    if(this.state.logo === false) {
      return (
        <div className="App">
          Hello
        </div>
      );
    }

    if(this.state.logo === true) {
      return (
        <div className="App">
          <img src={logo}></img>
        </div>
      );
    }
  }
}

export default App;
